import React from "react";
import { Container, Row, Col, Button, NavDropdown } from "react-bootstrap";

class ProjectForm extends React.Component {
  render() {
    return (
      <Container fluid={true}>
        style=
        {{
          color: "orange",
          marginTop: "100px",
          backgroundColor: "red"
        }}
        > Project Form
      </Container>
    );
  }
}
export default ProjectForm;
